import { createBrowserRouter } from "react-router-dom";
import RouterInfo from "./RouterInfo";
import Authorization from "../common/Auth/AuthorizationProps";

export const ReactRouterObject = createBrowserRouter(
  RouterInfo.map((routerItem) => {
    return routerItem.withAuthorization
      ? {
          path: routerItem.path,
          element: (
            <Authorization currentPath={routerItem.path.replace(/\/\*$/g, "")}>
              {routerItem.element}
            </Authorization>
          ),
        }
      : {
          path: routerItem.path,
          element: routerItem.element,
        };
  })
);
